import React from 'react';

export default class Tabela extends React.Component {
    render() {
        const sorted = this.props.lista.sort();
        const nomes = sorted.map(function(el, i) {
            return { index: i, value: el };
          })
        
        const listPessoas = nomes.map;

        return (
            <ol>
                { listPessoas.map(pessoa => <li>{ pessoa }</li>)}
            </ol>
        )
    }
}
